pragma solidity 0.5.0;
pragma experimental ABIEncoderV2;
// Experimental (string[]) - Do not use experimental features on live deployments.

contract Patient {
    address owner;
    uint256 accessCode;
    string[] fileHash;

    constructor() public {
        // Owner of contract
        owner = msg.sender;
        accessCode = 2255;

    }

    // checks whether the address(msg.sender) is same with owner address defined on contract.
    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }

    function set(string memory _fileHash) public {
        fileHash.push(_fileHash);
    }

    function get(uint256 _accessCode) public view returns (string[] memory) {
        require(accessCode == _accessCode, "Sender not authorized.");
        return fileHash;
    }

    function getAccessCode() public view returns (uint256) {
        return accessCode;
    }

    function getOwnerAddress() public view returns (address) {
        return owner;
    }

    function changeAccessCode(uint256 _accessCode) public onlyOwner {
        accessCode = _accessCode;
    }
}
